                    text: 'O Prof. Nailor Marques Jr.  uma referncia no mundo educacional, com formao em Direito e Letras pela Universidade Estadual de Maring e 31 anos de experincia em sala de aula. Diretor do Atelier de Redao por 28 anos e conselheiro executivo do Grupo Bellinatti Perez h 20 anos, ele tambm atua como consultor no Grupo Aval/Toledo Piza e foi consultor de vendas do Grupo Euphoria. Com quase 3.000 palestras e cursos ministrados no Brasil e no exterior, e autor de 32 livros, incluindo "Educao para a Felicidade" e "Sucesso com Inteligncia", Nailor compartilha seu vasto conhecimento em cursos exclusivos.\n\nNa Progressus EAD, buscamos sempre a excelncia, e com o Prof. Nailor Jr., voc ter acesso a uma formao de altssimo nvel. Aproveite a chance de aprender com um dos maiores nomes da educao e potencialize sua carreira com nossos cursos de Feedback Assertivo e Comunicao Persuasiva. Prepare-se para evoluir! \n\n#comunicao #feedback #carreiras #educao #cursosonline #carreiradesucesso #cursoonline',
