                    engine: 'linkedin',
                    text: "VIRACOPOS (VCP): TCU deve arquivar processo de repactuao e mercado aguarda desfecho sobre Concesso;\nEmbora o Tribunal de Contas da Unio (TCU) ainda no tenha se pronunciado oficialmente, a mdia nacional deu ampla divulgao na semana passada dando conta que o Tribunal vai arquivar o processo de mediao sobre a continuidade do contrato de concesso do aeroporto de Viracopos, em Campinas (SP), diante da falta de acordo com o governo.\nO prazo para se chegar a um entendimento entre o governo e a atual Concessionria Aeroportos Brasil Viracopos SA' (ABV), se encerrou, colocando um ponto final nas conversas no mbito da Secretaria de Controle Externo de Soluo Consensual e Preveno de Conflitos (SecexConsenso) da Corte  que mediava as conversas e precisaria dar aval aos termos.\nA lista de repactuaes de concesses de infraestrutura, que no incio deste ms de outubro teve sua primeira aprovao pelo TCU, tambm j comea a ter baixas. O contrato do aeroporto de Viracopos, controlado por Triunfo e UTC, no dever chegar a uma renegociao para permanncia dos scios, de acordo com fontes. Em rodovias, a ViaBahia, do grupo Roadis, at chegou a um acordo, mas para a sada da companhia, segundo apurou um dos veculos que divulgou o tema, o Jornal Valor.\nA ABV segue com normalidade em suas operaes e qualidade de servios, e informou que s se pronunciar aps o despacho oficial do Presidente do TCU, Ministro Bruno Dantas, que at o fechamento dessa edio no havia ocorrido. (por GPA LogNews)\n",
