                    engine: 'linkedin',
                    text: "XVI Convocatoria Premio Nacional de Ecologa Planeta Azul \nBanco de Occidente\n\nColegas y amigos, les comparto esta convocatoria:\n\nSi tu proyecto est comprometido con el cuidado del agua, el medio ambiente, el desarrollo sostenible, fomenta la participacin activa de la comunidad, no dudes en postularlo. \n\nConoce las bases de la convocatoria:\nCategoras participantes\n+ Grandes y medianas empresas.\n+ Emprendimientos y pequeas empresas.\n+ Fundaciones locales primer nivel, ONG's y organizaciones comunitarias.\n+ Academia: colegios, centros de investigacin y hub de innovacin.\nTemticas\nLos participantes en las diferentes categoras pueden presentar su proyecto en una o varias temticas: \n+ Conservacin y restauracin en torno al recurso hdrico.\n+ Uso sostenible del recurso hdrico.\n+ Innovacin.\n+ Educacin ambiental.\n  Criterios de evaluacin\n+ Contribucin a la naturaleza: impacto del proyecto en el territorio e indicadores de impacto.\n+ Contribucin a la comunidad: personas beneficiadas con el proyecto.\n+ Replicabilidad en otros territorios y/o contextos.\n+ Sostenibilidad y continuidad de los resultados.\n+ Adaptacin y mitigacin del cambio climtico.\n+ Inclusividad. \n\nRequisitos para participar\n+ Pertenecer a alguna de las categoras definidas para el Premio.\n+ El proyecto o iniciativa debe estar activo e implementado. No se premiarn ideas que no se hayan ejecutado o proyectos/iniciativas culminadas que no permitan reportar su evolucin en el tiempo.\n+ Diligenciar completamente el formulario de inscripcin dentro de las fechas establecidas en la convocatoria.\nCmo postular un proyecto?\n+ Paso 1: Registro\n+ Paso 2: Postulacin del proyecto\n\nObservaciones:\n+ Puedes editar el contenido del formulario las veces que desees, siempre y cuando no hayas dado clic en el botn POSTULAR.\n+ Puedes salir de la aplicacin e ingresar nuevamente iniciando la sesin con sus datos de usuario (Correo electrnico) y contrasea para editar o postular proyectos las veces que desees hasta el ltimo da de recepcin de formularios.\n+ Para recibir orientacin y asistencia en el proceso de postulacin de proyectos al Premio Planeta Azul, puedes contactar a Juan David Lpez Cano a su correo electrnico: JULOPEZC@bancodeoccidente.com.co\nhttps://lnkd.in/ekfaHErr\n\n*Nota\nLos participantes debern tener en cuenta que los ganadores por categora tendrn que destinar el 70 % del monto del premio al proyecto postulado y entregar al Banco de Occidente el informe con los indicadores de impacto y resultado de la inversin realizada. (Para mayor detalle revisar el documento con trminos y condiciones del premio).\n\n*Conoce los trminos y condiciones de la convocatoria:\nhttps://lnkd.in/eFJeTtwv",
