    //                 text: 'Como esta startup j movimentou R$ 1 bilho ao atender uma das maiores dores das PMEs\n\n\nFundada em 2020, a fintech PayHop procura resolver um dos maiores desafios do mercado de crdito no Brasil: a dificuldade de acesso ao crdito para pequenos e mdios varejistas. \n\nA PayHop atua conectando diretamente credores, como bancos e instituies financeiras, a varejistas, utilizando os recebveis de carto como garantia real para o crdito. Isso permite que os lojistas de farmcias, postos de gasolina e at mesmo grandes redes de supermercado tenham, por exemplo, maior prazo para pagamento e maiores volumes de estoque, especialmente em perodos sazonais, como Black Friday e Natal.\n\nO mercado de recebveis de carto tem expandido desde 2021, quando novas regulamentaes do Banco Central (BC) entraram em vigor. Essas mudanas visavam tornar as operaes mais transparentes e dar mais flexibilidade para os lojistas, que agora podem escolher qual a proposta mais atrativa entre diversas instituies financeiras. Base39, Flip e o InfinitePay da CloudWalk, so algumas das milhares de competidoras da PayHop. A Conta Azul, que oferece software de gesto financeira para PMEs, acaba de ser aprovada como instituio de pagamento e planeja oferecer crdito tambm.\n\n"Identificamos uma lacuna no mercado de recebveis, principalmente aps a regulamentao do BC, que abriu novas oportunidades para o uso criativo desse ativo", diz um dos fundadores, Eduardo Rossi, que acumula mais de 20 anos de experincia no setor financeiro, com passagens por grandes bancos como Ita e Citibank. Seu scio, Arthur Fontana possui mais de 15 anos de experincia no setor de fintechs.\n\n#Startups #Conexes #Inovao #Recebveis #Crdito #Empreendedorismo #Fintech\n\nhttps://lnkd.in/dwNnptYF',
