    //                 text: 'Ayer se realiz el foro del nuevo sistema de pagos Bre-B, un modelo que busca transferencias inmediatas e interoperables para disminuir el uso de efectivo y promover la bancarizacin. \n\nAna Mara Prieto, directora del departamento de sistema de pagos del Banco de la Repblica, recalc en el foro de Bre-B que la tarifa ser de $0 en los primeros tres aos para las entidades financieras. Una vez lleguemos al cuarto ao, el cobro que ser de $3,23 aplicable a cada punta, para un total de $6,46 por transaccin a los sistemas de pagos de bajo valor, dijo.\n\nQu quiere decir esto? Significa que el Emisor durante tres aos no le cobrar a los bancos por utilizar los servicios de infraestructura que va a ofrecer. Despus de este tiempo, se aplicar una tarifa de $3,23 a cada punta (a la entidad que enva y a la que recibe) para un total de $6,46, pero, habr cobro a los usuarios?\n\nLas entidades financieras podran determinar si van a generarle un cobro a los clientes y de qu cuanta. Hoy por hoy ya tenemos varias entidades, o la gran mayora en realidad, que tienen una tarifa cero para los pagos entre personas en el caso del sistema de pago Transfiya, dijo Prieto. Lo que espera el Emisor es que, con este anuncio, se consolide esa gratuidad. Adems, Prieto explic a LR que estos cobros a los usuarios, de ser definidos por el banco, pueden aplicarse en cualquier momento, incluso desde el primer da.\n\nLea la nota completa en el link de la BIO\n\n#breb #bancodelarepublica #pagos #emisor #transfiya #davivienda #daviplata #aval #grupoaval #bbva',
